package app.compose.viewmodels

import androidx.compose.runtime.mutableStateOf
import androidx.lifecycle.ViewModel
import app.compose.data.models.Speaker
import app.compose.data.models.Sponsor
import app.compose.data.repository.SpeakerRepository

class HomeViewModel(
    private val speakerRepository: SpeakerRepository = SpeakerRepository()
) : ViewModel() {

    val loadingSpeakers = mutableStateOf(false)
    val speakers = mutableStateOf(listOf<Speaker>())
    val keynoteSpeaker = mutableStateOf(Speaker("", "", true))
    val sponsors = listOf(
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
        Sponsor("data:image/png;base64,"),
    )

    private fun getSpeakers(count: Int? = null) {
        loadingSpeakers.value = true
        speakers.value = speakerRepository.getSpeakers(count)
        keynoteSpeaker.value = speakers.value.first { it.isKeynote }
        loadingSpeakers.value = false
    }

    init {
        getSpeakers()
    }
}